import React, { Component } from 'react';

class MoreInfo extends Component {

	render() {
		return(
			<div className= "moreInfo">
				<h2>Links</h2>
				<h3><a href={localStorage.github}>github</a></h3>
				<h3><a href={localStorage.demo}>video</a></h3>
				<h3><a href={localStorage.live}>live</a></h3>
			</div>
		)
	}
}

export default MoreInfo
